import {A11y,Navigation,Pagination} from 'swiper'
import 'swiper/css';
import "swiper/css/pagination";
import "swiper/css/navigation";
import {Swiper, SwiperSlide} from 'swiper/react'
import { SwiperNavButtons } from './SwiperNavButton';
import Case from "./Usecase";

const  Carousel = () => {

    return(

<>


      <Swiper className='wrapper'
      modules={ [Navigation, Pagination, A11y]}
      spaceBetween={30}
      slidesPerView="auto"
      >


          <SwiperSlide className="res-slide" > <Case image='images/icon4.png' header='Web Development Freelancers' title='Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod
                       tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim
                       veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex
                       ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur.' /></SwiperSlide>
          <SwiperSlide className="res-slide" />
          <SwiperSlide className="res-slide" />
          <SwiperSlide className="res-slide" />
          <SwiperSlide className="res-slide" />
          <SwiperSlide className="res-slide" />
          <SwiperSlide className="res-slide" />
          <SwiperSlide className="res-slide" />
          <SwiperNavButtons />


      </Swiper>
</>


    )
}
export default  Carousel;
